webpackJsonp([1406],{"./node_modules/json-loader/index.js!./.cache/json/articles-javascript-standard-objects-array-array-prototype-reverse.json":function(e,r){e.exports={data:{markdownRemark:{html:'<p>The JavaScript array method <code>.reverse()</code> will reverse the order of the elements within the array.</p>\n<p><strong>Syntax</strong></p>\n<pre><code>var array = [1, 2, 3, 4, 5];\narray.reverse();\n</code></pre>\n<h2>Description</h2>\n<p><code>.reverse()</code> reverses the index of the elements of an array.</p>\n<h2>Examples</h2>\n<p><strong>Use <code>.reverse()</code> to reverse the elements of an array</strong></p>\n<pre><code>var array = [1, 2, 3, 4, 5];\nconsole.log(array);\n// Console will output 1, 2, 3, 4, 5\n\narray.reverse();\n\nconsole.log(array);\n/* Console will output 5, 4, 3, 2, 1 and\nthe variable array now contains the set [5, 4, 3, 2, 1] */\n</code></pre>\n<p>Source <a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/reverse">MDN</a></p>',frontmatter:{title:"Array.prototype.reverse",parent:"/home/stuart/guides/src/pages/articles/javascript/standard-objects/array/array-prototype-reverse/index.md absPath of file"}}},pathContext:{slug:"/articles/javascript/standard-objects/array/array-prototype-reverse/"}}}});
